let templateId = 0;

export const getTemplateId = () => {
  return templateId;
};

export const setTemplateId = (newTemplateId) => {
  templateId = newTemplateId;
};

let DId = 0;

export const getDId = () => {
  return templateId;
};

export const setDId = (newTemplateId) => {
  templateId = newTemplateId;
};
